Ext.data.JsonP.java_net_URI({"tagname":"class","name":"java.net.URI","autodetected":{},"files":[{"filename":"URI.js","href":"URI.html#java-net-URI"}],"extends":"java.lang.Object","author":[{"tagname":"author","name":"Mark Reinhold","email":null}],"since":"1.4","members":[{"name":"compareTo","tagname":"method","owner":"java.net.URI","id":"method-compareTo","meta":{}},{"name":"create","tagname":"method","owner":"java.net.URI","id":"method-create","meta":{}},{"name":"equals","tagname":"method","owner":"java.net.URI","id":"method-equals","meta":{}},{"name":"getAuthority","tagname":"method","owner":"java.net.URI","id":"method-getAuthority","meta":{}},{"name":"getFragment","tagname":"method","owner":"java.net.URI","id":"method-getFragment","meta":{}},{"name":"getHost","tagname":"method","owner":"java.net.URI","id":"method-getHost","meta":{}},{"name":"getPath","tagname":"method","owner":"java.net.URI","id":"method-getPath","meta":{}},{"name":"getPort","tagname":"method","owner":"java.net.URI","id":"method-getPort","meta":{}},{"name":"getQuery","tagname":"method","owner":"java.net.URI","id":"method-getQuery","meta":{}},{"name":"getRawAuthority","tagname":"method","owner":"java.net.URI","id":"method-getRawAuthority","meta":{}},{"name":"getRawFragment","tagname":"method","owner":"java.net.URI","id":"method-getRawFragment","meta":{}},{"name":"getRawPath","tagname":"method","owner":"java.net.URI","id":"method-getRawPath","meta":{}},{"name":"getRawQuery","tagname":"method","owner":"java.net.URI","id":"method-getRawQuery","meta":{}},{"name":"getRawSchemeSpecificPart","tagname":"method","owner":"java.net.URI","id":"method-getRawSchemeSpecificPart","meta":{}},{"name":"getRawUserInfo","tagname":"method","owner":"java.net.URI","id":"method-getRawUserInfo","meta":{}},{"name":"getScheme","tagname":"method","owner":"java.net.URI","id":"method-getScheme","meta":{}},{"name":"getSchemeSpecificPart","tagname":"method","owner":"java.net.URI","id":"method-getSchemeSpecificPart","meta":{}},{"name":"getUserInfo","tagname":"method","owner":"java.net.URI","id":"method-getUserInfo","meta":{}},{"name":"hashCode","tagname":"method","owner":"java.net.URI","id":"method-hashCode","meta":{}},{"name":"isAbsolute","tagname":"method","owner":"java.net.URI","id":"method-isAbsolute","meta":{}},{"name":"isOpaque","tagname":"method","owner":"java.net.URI","id":"method-isOpaque","meta":{}},{"name":"normalize","tagname":"method","owner":"java.net.URI","id":"method-normalize","meta":{}},{"name":"parseServerAuthority","tagname":"method","owner":"java.net.URI","id":"method-parseServerAuthority","meta":{}},{"name":"relativize","tagname":"method","owner":"java.net.URI","id":"method-relativize","meta":{}},{"name":"resolve","tagname":"method","owner":"java.net.URI","id":"method-resolve","meta":{}},{"name":"toASCIIString","tagname":"method","owner":"java.net.URI","id":"method-toASCIIString","meta":{}},{"name":"toString","tagname":"method","owner":"java.net.URI","id":"method-toString","meta":{}},{"name":"toURL","tagname":"method","owner":"java.net.URI","id":"method-toURL","meta":{}}],"alternateClassNames":[],"aliases":{},"id":"class-java.net.URI","short_doc":"implements java.lang.Comparable\n\n implements java.io.Serializable\n\nRepresents a Uniform Resource Identifier (URI) ref...","classIcon":"icon-class","superclasses":["java.lang.Object"],"subclasses":[],"mixedInto":[],"mixins":[],"parentMixins":[],"requires":[],"uses":[],"html":"<div><pre class=\"hierarchy\"><h4>Hierarchy</h4><div class='subclass first-child'>java.lang.Object<div class='subclass '><strong>java.net.URI</strong></div></div><h4>Files</h4><div class='dependency'><a href='source/URI.html#java-net-URI' target='_blank'>URI.js</a></div></pre><div class='doc-contents'><p>implements java.lang.Comparable</p>\n\n<p> implements java.io.Serializable</p>\n\n<p>Represents a Uniform Resource Identifier (URI) reference.</p>\n\n<p> <p> Aside from some minor deviations noted below, an instance of this\n class represents a URI reference as defined by\n <a href=\"http://www.ietf.org/rfc/rfc2396.txt\"><i>RFC&nbsp;2396: Uniform\n Resource Identifiers (URI): Generic Syntax</i></a>, amended by <a\n href=\"http://www.ietf.org/rfc/rfc2732.txt\"><i>RFC&nbsp;2732: Format for\n Literal IPv6 Addresses in URLs</i></a>. The Literal IPv6 address format\n also supports scope_ids. The syntax and usage of scope_ids is described\n <a href=\"Inet6Address.html#scoped\">here</a>.\n This class provides constructors for creating URI instances from\n their components or by parsing their string forms, methods for accessing the\n various components of an instance, and methods for normalizing, resolving,\n and relativizing URI instances.  Instances of this class are immutable.</p>\n\n<p> <h3> URI syntax and components </h3></p>\n\n<p> At the highest level a URI reference (hereinafter simply \"URI\") in string\n form has the syntax</p>\n\n<p> <blockquote>\n [<i>scheme</i><b>{@code :}</b>]<i>scheme-specific-part</i>[<b>{@code #}</b><i>fragment</i>]\n </blockquote></p>\n\n<p> where square brackets [...] delineate optional components and the characters\n <b>{@code :}</b> and <b>{@code #}</b> stand for themselves.</p>\n\n<p> <p> An <i>absolute</i> URI specifies a scheme; a URI that is not absolute is\n said to be <i>relative</i>.  URIs are also classified according to whether\n they are <i>opaque</i> or <i>hierarchical</i>.</p>\n\n<p> <p> An <i>opaque</i> URI is an absolute URI whose scheme-specific part does\n not begin with a slash character ({@code '/'}).  Opaque URIs are not\n subject to further parsing.  Some examples of opaque URIs are:</p>\n\n<p> <blockquote><table cellpadding=0 cellspacing=0 summary=\"layout\">\n <tr><td>{@code mailto:java-net@java.sun.com}<td></td></td></tr>\n <tr><td>{@code news:comp.lang.java}<td></td></td></tr>\n <tr><td>{@code urn:isbn:096139210x}</td></tr>\n </table></blockquote></p>\n\n<p> <p> A <i>hierarchical</i> URI is either an absolute URI whose\n scheme-specific part begins with a slash character, or a relative URI, that\n is, a URI that does not specify a scheme.  Some examples of hierarchical\n URIs are:</p>\n\n<p> <blockquote>\n {@code http://java.sun.com/j2se/1.3/}<br>\n {@code docs/guide/collections/designfaq.html#28}<br>\n {@code ../../../demo/jfc/SwingSet2/src/SwingSet2.java}<br>\n {@code file:///~/calendar}\n </blockquote></p>\n\n<p> <p> A hierarchical URI is subject to further parsing according to the syntax</p>\n\n<p> <blockquote>\n [<i>scheme</i><b>{@code :}</b>][<b>{@code //}</b><i>authority</i>][<i>path</i>][<b>{@code ?}</b><i>query</i>][<b>{@code #}</b><i>fragment</i>]\n </blockquote></p>\n\n<p> where the characters <b>{@code :}</b>, <b>{@code /}</b>,\n <b>{@code ?}</b>, and <b>{@code #}</b> stand for themselves.  The\n scheme-specific part of a hierarchical URI consists of the characters\n between the scheme and fragment components.</p>\n\n<p> <p> The authority component of a hierarchical URI is, if specified, either\n <i>server-based</i> or <i>registry-based</i>.  A server-based authority\n parses according to the familiar syntax</p>\n\n<p> <blockquote>\n [<i>user-info</i><b>{@code }</b>]<i>host</i>[<b>{@code :}</b><i>port</i>]\n </blockquote></p>\n\n<p> where the characters <b>{@code }</b> and <b>{@code :}</b> stand for\n themselves.  Nearly all URI schemes currently in use are server-based.  An\n authority component that does not parse in this way is considered to be\n registry-based.</p>\n\n<p> <p> The path component of a hierarchical URI is itself said to be absolute\n if it begins with a slash character ({@code '/'}); otherwise it is\n relative.  The path of a hierarchical URI that is either absolute or\n specifies an authority is always absolute.</p>\n\n<p> <p> All told, then, a URI instance has the following nine components:</p>\n\n<p> <blockquote><table summary=\"Describes the components of a URI:scheme,scheme-specific-part,authority,user-info,host,port,path,query,fragment\">\n <tr><th><i>Component</i></th><th><i>Type</i></th></tr>\n <tr><td>scheme</td><td>{@code String}</td></tr>\n <tr><td>scheme-specific-part&nbsp;&nbsp;&nbsp;&nbsp;</td><td>{@code String}</td></tr>\n <tr><td>authority</td><td>{@code String}</td></tr>\n <tr><td>user-info</td><td>{@code String}</td></tr>\n <tr><td>host</td><td>{@code String}</td></tr>\n <tr><td>port</td><td>{@code int}</td></tr>\n <tr><td>path</td><td>{@code String}</td></tr>\n <tr><td>query</td><td>{@code String}</td></tr>\n <tr><td>fragment</td><td>{@code String}</td></tr>\n </table></blockquote></p>\n\n<p> In a given instance any particular component is either <i>undefined</i> or\n <i>defined</i> with a distinct value.  Undefined string components are\n represented by {@code null}, while undefined integer components are\n represented by {@code -1}.  A string component may be defined to have the\n empty string as its value; this is not equivalent to that component being\n undefined.</p>\n\n<p> <p> Whether a particular component is or is not defined in an instance\n depends upon the type of the URI being represented.  An absolute URI has a\n scheme component.  An opaque URI has a scheme, a scheme-specific part, and\n possibly a fragment, but has no other components.  A hierarchical URI always\n has a path (though it may be empty) and a scheme-specific-part (which at\n least contains the path), and may have any of the other components.  If the\n authority component is present and is server-based then the host component\n will be defined and the user-information and port components may be defined.</p>\n\n<p> <h4> Operations on URI instances </h4></p>\n\n<p> The key operations supported by this class are those of\n <i>normalization</i>, <i>resolution</i>, and <i>relativization</i>.</p>\n\n<p> <p> <i>Normalization</i> is the process of removing unnecessary {@code \".\"}\n and {@code \"..\"} segments from the path component of a hierarchical URI.\n Each {@code \".\"} segment is simply removed.  A {@code \"..\"} segment is\n removed only if it is preceded by a non-{@code \"..\"} segment.\n Normalization has no effect upon opaque URIs.</p>\n\n<p> <p> <i>Resolution</i> is the process of resolving one URI against another,\n <i>base</i> URI.  The resulting URI is constructed from components of both\n URIs in the manner specified by RFC&nbsp;2396, taking components from the\n base URI for those not specified in the original.  For hierarchical URIs,\n the path of the original is resolved against the path of the base and then\n normalized.  The result, for example, of resolving</p>\n\n<p> <blockquote>\n {@code docs/guide/collections/designfaq.html#28}\n &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\n &nbsp;&nbsp;&nbsp;&nbsp;(1)\n </blockquote></p>\n\n<p> against the base URI {@code http://java.sun.com/j2se/1.3/} is the result\n URI</p>\n\n<p> <blockquote>\n {@code http://java.sun.com/j2se/1.3/docs/guide/collections/designfaq.html#28}\n </blockquote></p>\n\n<p> Resolving the relative URI</p>\n\n<p> <blockquote>\n {@code ../../../demo/jfc/SwingSet2/src/SwingSet2.java}&nbsp;&nbsp;&nbsp;&nbsp;(2)\n </blockquote></p>\n\n<p> against this result yields, in turn,</p>\n\n<p> <blockquote>\n {@code http://java.sun.com/j2se/1.3/demo/jfc/SwingSet2/src/SwingSet2.java}\n </blockquote></p>\n\n<p> Resolution of both absolute and relative URIs, and of both absolute and\n relative paths in the case of hierarchical URIs, is supported.  Resolving\n the URI {@code file:///~calendar} against any other URI simply yields the\n original URI, since it is absolute.  Resolving the relative URI (2) above\n against the relative base URI (1) yields the normalized, but still relative,\n URI</p>\n\n<p> <blockquote>\n {@code demo/jfc/SwingSet2/src/SwingSet2.java}\n </blockquote></p>\n\n<p> <p> <i>Relativization</i>, finally, is the inverse of resolution: For any\n two normalized URIs <i>u</i> and&nbsp;<i>v</i>,</p>\n\n<p> <blockquote>\n   <i>u</i>{@code .relativize(}<i>u</i>{@code .resolve(}<i>v</i>{@code )).equals(}<i>v</i>{@code )}&nbsp;&nbsp;and<br>\n   <i>u</i>{@code .resolve(}<i>u</i>{@code .relativize(}<i>v</i>{@code )).equals(}<i>v</i>{@code )}&nbsp;&nbsp;.<br>\n </blockquote></p>\n\n<p> This operation is often useful when constructing a document containing URIs\n that must be made relative to the base URI of the document wherever\n possible.  For example, relativizing the URI</p>\n\n<p> <blockquote>\n {@code http://java.sun.com/j2se/1.3/docs/guide/index.html}\n </blockquote></p>\n\n<p> against the base URI</p>\n\n<p> <blockquote>\n {@code http://java.sun.com/j2se/1.3}\n </blockquote></p>\n\n<p> yields the relative URI {@code docs/guide/index.html}.</p>\n\n<p> <h4> Character categories </h4></p>\n\n<p> RFC&nbsp;2396 specifies precisely which characters are permitted in the\n various components of a URI reference.  The following categories, most of\n which are taken from that specification, are used below to describe these\n constraints:</p>\n\n<p> <blockquote><table cellspacing=2 summary=\"Describes categories alpha,digit,alphanum,unreserved,punct,reserved,escaped,and other\">\n   <tr><th valign=top><i>alpha</i></th>\n       <td>The US-ASCII alphabetic characters,\n        {@code 'A'}&nbsp;through&nbsp;{@code 'Z'}\n        and {@code 'a'}&nbsp;through&nbsp;{@code 'z'}</td></tr>\n   <tr><th valign=top><i>digit</i></th>\n       <td>The US-ASCII decimal digit characters,\n       {@code '0'}&nbsp;through&nbsp;{@code '9'}</td></tr>\n   <tr><th valign=top><i>alphanum</i></th>\n       <td>All <i>alpha</i> and <i>digit</i> characters</td></tr>\n   <tr><th valign=top><i>unreserved</i>&nbsp;&nbsp;&nbsp;&nbsp;</th>\n       <td>All <i>alphanum</i> characters together with those in the string\n        {@code \"_-!.~'()*\"}</td></tr>\n   <tr><th valign=top><i>punct</i></th>\n       <td>The characters in the string {@code \",;:$&amp;+=\"}</td></tr>\n   <tr><th valign=top><i>reserved</i></th>\n       <td>All <i>punct</i> characters together with those in the string\n        {@code \"?/[]@\"}</td></tr>\n   <tr><th valign=top><i>escaped</i></th>\n       <td>Escaped octets, that is, triplets consisting of the percent\n           character ({@code '%'}) followed by two hexadecimal digits\n           ({@code '0'}-{@code '9'}, {@code 'A'}-{@code 'F'}, and\n           {@code 'a'}-{@code 'f'})</td></tr>\n   <tr><th valign=top><i>other</i></th>\n       <td>The Unicode characters that are not in the US-ASCII character set,\n           are not control characters (according to the Character.isISOControl\n           method), and are not space characters (according to the Character.isSpaceChar\n           method)&nbsp;&nbsp;<i>(<b>Deviation from RFC 2396</b>, which is\n           limited to US-ASCII)</i></td></tr>\n </table></blockquote></p>\n\n<p> <p><a name=\"legal-chars\"></a> The set of all legal URI characters consists of\n the <i>unreserved</i>, <i>reserved</i>, <i>escaped</i>, and <i>other</i>\n characters.</p>\n\n<p> <h4> Escaped octets, quotation, encoding, and decoding </h4></p>\n\n<p> RFC 2396 allows escaped octets to appear in the user-info, path, query, and\n fragment components.  Escaping serves two purposes in URIs:</p>\n\n<p> <ul></ul></p>\n\n<p>   <li><p> To <i>encode</i> non-US-ASCII characters when a URI is required to\n   conform strictly to RFC&nbsp;2396 by not containing any <i>other</i>\n   characters.  </p></li></p>\n\n<p>   <li><p> To <i>quote</i> characters that are otherwise illegal in a\n   component.  The user-info, path, query, and fragment components differ\n   slightly in terms of which characters are considered legal and illegal.\n   </p></li></p>\n\n<p> </p>\n\n<p> These purposes are served in this class by three related operations:</p>\n\n<p> <ul></ul></p>\n\n<p>   <li><p><a name=\"encode\"></a> A character is <i>encoded</i> by replacing it\n   with the sequence of escaped octets that represent that character in the\n   UTF-8 character set.  The Euro currency symbol ({@code '\\u20AC'}),\n   for example, is encoded as {@code \"%E2%82%AC\"}.  <i>(<b>Deviation from\n   RFC&nbsp;2396</b>, which does not specify any particular character\n   set.)</i> </p></li></p>\n\n<p>   <li><p><a name=\"quote\"></a> An illegal character is <i>quoted</i> simply by\n   encoding it.  The space character, for example, is quoted by replacing it\n   with {@code \"%20\"}.  UTF-8 contains US-ASCII, hence for US-ASCII\n   characters this transformation has exactly the effect required by\n   RFC&nbsp;2396. </p></li></p>\n\n<p>   <li><p><a name=\"decode\"></a>\n   A sequence of escaped octets is <i>decoded</i> by\n   replacing it with the sequence of characters that it represents in the\n   UTF-8 character set.  UTF-8 contains US-ASCII, hence decoding has the\n   effect of de-quoting any quoted US-ASCII characters as well as that of\n   decoding any encoded non-US-ASCII characters.  If a <a\n   href=\"../nio/charset/CharsetDecoder.html#ce\">decoding error</a> occurs\n   when decoding the escaped octets then the erroneous octets are replaced by\n   {@code '\\uFFFD'}, the Unicode replacement character.  </p></li></p>\n\n<p> </p>\n\n<p> These operations are exposed in the constructors and methods of this class\n as follows:</p>\n\n<p> <ul></ul></p>\n\n<p>   <li><p> The {@linkplain #URI(java.lang.String) single-argument\n   constructor} requires any illegal characters in its argument to be\n   quoted and preserves any escaped octets and <i>other</i> characters that\n   are present.  </p></li></p>\n\n<p>   <li><p> The {@linkplain\n   #URI(java.lang.String,java.lang.String,java.lang.String,int,java.lang.String,java.lang.String,java.lang.String)\n   multi-argument constructors} quote illegal characters as\n   required by the components in which they appear.  The percent character\n   ({@code '%'}) is always quoted by these constructors.  Any <i>other</i>\n   characters are preserved.  </p></li></p>\n\n<p>   <li><p> The getRawUserInfo, getRawPath, getRawQuery, getRawFragment, getRawAuthority, and getRawSchemeSpecificPart methods return the\n   values of their corresponding components in raw form, without interpreting\n   any escaped octets.  The strings returned by these methods may contain\n   both escaped octets and <i>other</i> characters, and will not contain any\n   illegal characters.  </p></li></p>\n\n<p>   <li><p> The getUserInfo, getPath, getQuery, getFragment, getAuthority, and getSchemeSpecificPart methods decode any escaped\n   octets in their corresponding components.  The strings returned by these\n   methods may contain both <i>other</i> characters and illegal characters,\n   and will not contain any escaped octets.  </p></li></p>\n\n<p>   <li><p> The toString method returns a URI string with\n   all necessary quotation but which may contain <i>other</i> characters.\n   </p></li></p>\n\n<p>   <li><p> The toASCIIString method returns a fully\n   quoted and encoded URI string that does not contain any <i>other</i>\n   characters.  </p></li></p>\n\n<p> </p>\n\n<p> <h4> Identities </h4></p>\n\n<p> For any URI <i>u</i>, it is always the case that</p>\n\n<p> <blockquote>\n {@code new URI(}<i>u</i>{@code .toString()).equals(}<i>u</i>{@code )}&nbsp;.\n </blockquote></p>\n\n<p> For any URI <i>u</i> that does not contain redundant syntax such as two\n slashes before an empty authority (as in {@code file:///tmp/}&nbsp;) or a\n colon following a host name but no port (as in\n {@code http://java.sun.com:}&nbsp;), and that does not encode characters\n except those that must be quoted, the following identities also hold:</p>\n\n<pre>     new URI(<i>u</i>.getScheme(),\n             <i>u</i>.getSchemeSpecificPart(),\n             <i>u</i>.getFragment())\n     .equals(<i>u</i>)</pre>\n\n\n<p> in all cases,</p>\n\n<pre>     new URI(<i>u</i>.getScheme(),\n             <i>u</i>.getUserInfo(), <i>u</i>.getAuthority(),\n             <i>u</i>.getPath(), <i>u</i>.getQuery(),\n             <i>u</i>.getFragment())\n     .equals(<i>u</i>)</pre>\n\n\n<p> if <i>u</i> is hierarchical, and</p>\n\n<pre>     new URI(<i>u</i>.getScheme(),\n             <i>u</i>.getUserInfo(), <i>u</i>.getHost(), <i>u</i>.getPort(),\n             <i>u</i>.getPath(), <i>u</i>.getQuery(),\n             <i>u</i>.getFragment())\n     .equals(<i>u</i>)</pre>\n\n\n<p> if <i>u</i> is hierarchical and has either no authority or a server-based\n authority.</p>\n\n<p> <h4> URIs, URLs, and URNs </h4></p>\n\n<p> A URI is a uniform resource <i>identifier</i> while a URL is a uniform\n resource <i>locator</i>.  Hence every URL is a URI, abstractly speaking, but\n not every URI is a URL.  This is because there is another subcategory of\n URIs, uniform resource <i>names</i> (URNs), which name resources but do not\n specify how to locate them.  The {@code mailto}, {@code news}, and\n {@code isbn} URIs shown above are examples of URNs.</p>\n\n<p> <p> The conceptual distinction between URIs and URLs is reflected in the\n differences between this class and the <a href=\"#!/api/java.net.URL\" rel=\"java.net.URL\" class=\"docClass\">java.net.URL</a> class.</p>\n\n<p> <p> An instance of this class represents a URI reference in the syntactic\n sense defined by RFC&nbsp;2396.  A URI may be either absolute or relative.\n A URI string is parsed according to the generic syntax without regard to the\n scheme, if any, that it specifies.  No lookup of the host, if any, is\n performed, and no scheme-dependent stream handler is constructed.  Equality,\n hashing, and comparison are defined strictly in terms of the character\n content of the instance.  In other words, a URI instance is little more than\n a structured string that supports the syntactic, scheme-independent\n operations of comparison, normalization, resolution, and relativization.</p>\n\n<p> <p> An instance of the <a href=\"#!/api/java.net.URL\" rel=\"java.net.URL\" class=\"docClass\">java.net.URL</a> class, by contrast, represents the\n syntactic components of a URL together with some of the information required\n to access the resource that it describes.  A URL must be absolute, that is,\n it must always specify a scheme.  A URL string is parsed according to its\n scheme.  A stream handler is always established for a URL, and in fact it is\n impossible to create a URL instance for a scheme for which no handler is\n available.  Equality and hashing depend upon both the scheme and the\n Internet address of the host, if any; comparison is not defined.  In other\n words, a URL is a structured string that supports the syntactic operation of\n resolution as well as the network I/O operations of looking up the host and\n opening a connection to the specified resource.</p>\n\n<p> @see <a href=\"http://www.ietf.org/rfc/rfc2279.txt\">RFC&nbsp;2279: UTF-8, a transformation format of ISO 10646</a>\n @see <a href=\"http://www.ietf.org/rfc/rfc2373.txt\">RFC&nbsp;2373: IPv6 Addressing Architecture</a>\n @see <a href=\"http://www.ietf.org/rfc/rfc2396.txt\">RFC&nbsp;2396: Uniform Resource Identifiers (URI): Generic Syntax</a>\n @see <a href=\"http://www.ietf.org/rfc/rfc2732.txt\">RFC&nbsp;2732: Format for Literal IPv6 Addresses in URLs</a></p>\n        <p>Available since: <b>1.4</b></p>\n</div><div class='members'><div class='members-section'><div class='definedBy'>Defined By</div><h3 class='members-title icon-method'>Methods</h3><div class='subsection'><div id='method-compareTo' class='member first-child not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='java.net.URI'>java.net.URI</span><br/><a href='source/URI.html#java-net-URI-method-compareTo' target='_blank' class='view-source'>view source</a></div><a href='#!/api/java.net.URI-method-compareTo' class='name expandable'>compareTo</a>( <span class='pre'>that</span> ) : Number<span class=\"signature\"></span></div><div class='description'><div class='short'>Compares this URI to another object, which must be a URI. ...</div><div class='long'><p>Compares this URI to another object, which must be a URI.</p>\n\n<p> <p> When comparing corresponding components of two URIs, if one\n component is undefined but the other is defined then the first is\n considered to be less than the second.  Unless otherwise noted, string\n components are ordered according to their natural, case-sensitive\n ordering as defined by the String.compareTo method.  String components that are subject to\n encoding are compared by comparing their raw forms rather than their\n encoded forms.</p>\n\n<p> <p> The ordering of URIs is defined as follows: </p></p>\n\n<p> <ul></ul></p>\n\n<p>   <li><p> Two URIs with different schemes are ordered according the\n   ordering of their schemes, without regard to case. </p></li></p>\n\n<p>   <li><p> A hierarchical URI is considered to be less than an opaque URI\n   with an identical scheme. </p></li></p>\n\n<p>   <li><p> Two opaque URIs with identical schemes are ordered according\n   to the ordering of their scheme-specific parts. </p></li></p>\n\n<p>   <li><p> Two opaque URIs with identical schemes and scheme-specific\n   parts are ordered according to the ordering of their\n   fragments. </p></li></p>\n\n<p>   <li><p> Two hierarchical URIs with identical schemes are ordered\n   according to the ordering of their authority components: </p></li></p>\n\n<p>   <ul></ul></p>\n\n<pre><code> &lt;li&gt;&lt;p&gt; If both authority components are server-based then the URIs\n are ordered according to their user-information components; if these\n components are identical then the URIs are ordered according to the\n ordering of their hosts, without regard to case; if the hosts are\n identical then the URIs are ordered according to the ordering of\n their ports. &lt;/p&gt;&lt;/li&gt;\n\n &lt;li&gt;&lt;p&gt; If one or both authority components are registry-based then\n the URIs are ordered according to the ordering of their authority\n components. &lt;/p&gt;&lt;/li&gt;\n</code></pre>\n\n<p>   </p>\n\n<p>   <li><p> Finally, two hierarchical URIs with identical schemes and\n   authority components are ordered according to the ordering of their\n   paths; if their paths are identical then they are ordered according to\n   the ordering of their queries; if the queries are identical then they\n   are ordered according to the order of their fragments. </p></li></p>\n\n<p> </p>\n\n<p> <p> This method satisfies the general contract of the Comparable.compareTo\n method. </p></p>\n<h3 class=\"pa\">Parameters</h3><ul><li><span class='pre'>that</span> : Object {URI}<div class='sub-desc'><p>The object to which this URI is to be compared</p>\n</div></li></ul><h3 class='pa'>Returns</h3><ul><li><span class='pre'>Number</span><div class='sub-desc'><p>A negative integer, zero, or a positive integer as this URI is\n          less than, equal to, or greater than the given URI</p>\n</div></li></ul><h3 class='pa'>Throws</h3><ul><li><span class='pre'>Object</span><div class='sub-desc'><p>ClassCastException\n          If the given object is not a URI</p>\n</div></li></ul></div></div></div><div id='method-create' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='java.net.URI'>java.net.URI</span><br/><a href='source/URI.html#java-net-URI-method-create' target='_blank' class='view-source'>view source</a></div><a href='#!/api/java.net.URI-method-create' class='name expandable'>create</a>( <span class='pre'>str</span> ) : Object {java.net.URI}<span class=\"signature\"></span></div><div class='description'><div class='short'>Creates a URI by parsing the given string. ...</div><div class='long'><p>Creates a URI by parsing the given string.</p>\n\n<p> <p> This convenience factory method works as if by invoking the URI(String) constructor; any <a href=\"#!/api/java.net.URISyntaxException\" rel=\"java.net.URISyntaxException\" class=\"docClass\">java.net.URISyntaxException</a> thrown by the\n constructor is caught and wrapped in a new IllegalArgumentException object, which is then thrown.</p>\n\n<p> <p> This method is provided for use in situations where it is known that\n the given string is a legal URI, for example for URI constants declared\n within in a program, and so it would be considered a programming error\n for the string not to parse as such.  The constructors, which throw\n <a href=\"#!/api/java.net.URISyntaxException\" rel=\"java.net.URISyntaxException\" class=\"docClass\">java.net.URISyntaxException</a> directly, should be used situations where a\n URI is being constructed from user input or from some other source that\n may be prone to errors.  </p></p>\n<h3 class=\"pa\">Parameters</h3><ul><li><span class='pre'>str</span> : String<div class='sub-desc'><p>The string to be parsed into a URI</p>\n</div></li></ul><h3 class='pa'>Returns</h3><ul><li><span class='pre'>Object {java.net.URI}</span><div class='sub-desc'><p>The new URI</p>\n</div></li></ul><h3 class='pa'>Throws</h3><ul><li><span class='pre'>Object</span><div class='sub-desc'><p>NullPointerException\n          If {@code str} is {@code null}</p>\n</div></li><li><span class='pre'>Object</span><div class='sub-desc'><p>IllegalArgumentException\n          If the given string violates RFC&nbsp;2396</p>\n</div></li></ul></div></div></div><div id='method-equals' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='java.net.URI'>java.net.URI</span><br/><a href='source/URI.html#java-net-URI-method-equals' target='_blank' class='view-source'>view source</a></div><a href='#!/api/java.net.URI-method-equals' class='name expandable'>equals</a>( <span class='pre'>ob</span> ) : Boolean<span class=\"signature\"></span></div><div class='description'><div class='short'>Tests this URI for equality with another object. ...</div><div class='long'><p>Tests this URI for equality with another object.</p>\n\n<p> <p> If the given object is not a URI then this method immediately\n returns {@code false}.</p>\n\n<p> <p> For two URIs to be considered equal requires that either both are\n opaque or both are hierarchical.  Their schemes must either both be\n undefined or else be equal without regard to case. Their fragments\n must either both be undefined or else be equal.</p>\n\n<p> <p> For two opaque URIs to be considered equal, their scheme-specific\n parts must be equal.</p>\n\n<p> <p> For two hierarchical URIs to be considered equal, their paths must\n be equal and their queries must either both be undefined or else be\n equal.  Their authorities must either both be undefined, or both be\n registry-based, or both be server-based.  If their authorities are\n defined and are registry-based, then they must be equal.  If their\n authorities are defined and are server-based, then their hosts must be\n equal without regard to case, their port numbers must be equal, and\n their user-information components must be equal.</p>\n\n<p> <p> When testing the user-information, path, query, fragment, authority,\n or scheme-specific parts of two URIs for equality, the raw forms rather\n than the encoded forms of these components are compared and the\n hexadecimal digits of escaped octets are compared without regard to\n case.</p>\n\n<p> <p> This method satisfies the general contract of the Object.equals method. </p></p>\n<h3 class=\"pa\">Parameters</h3><ul><li><span class='pre'>ob</span> : Object {Object}<div class='sub-desc'><p>The object to which this object is to be compared</p>\n</div></li></ul><h3 class='pa'>Returns</h3><ul><li><span class='pre'>Boolean</span><div class='sub-desc'><p>{@code true} if, and only if, the given object is a URI that\n          is identical to this URI</p>\n</div></li></ul></div></div></div><div id='method-getAuthority' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='java.net.URI'>java.net.URI</span><br/><a href='source/URI.html#java-net-URI-method-getAuthority' target='_blank' class='view-source'>view source</a></div><a href='#!/api/java.net.URI-method-getAuthority' class='name expandable'>getAuthority</a>( <span class='pre'></span> ) : String<span class=\"signature\"></span></div><div class='description'><div class='short'>Returns the decoded authority component of this URI. ...</div><div class='long'><p>Returns the decoded authority component of this URI.</p>\n\n<p> <p> The string returned by this method is equal to that returned by the\n getRawAuthority method except that all\n sequences of escaped octets are <a href=\"#decode\">decoded</a>.  </p></p>\n<h3 class='pa'>Returns</h3><ul><li><span class='pre'>String</span><div class='sub-desc'><p>The decoded authority component of this URI,\n          or {@code null} if the authority is undefined</p>\n</div></li></ul></div></div></div><div id='method-getFragment' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='java.net.URI'>java.net.URI</span><br/><a href='source/URI.html#java-net-URI-method-getFragment' target='_blank' class='view-source'>view source</a></div><a href='#!/api/java.net.URI-method-getFragment' class='name expandable'>getFragment</a>( <span class='pre'></span> ) : String<span class=\"signature\"></span></div><div class='description'><div class='short'>Returns the decoded fragment component of this URI. ...</div><div class='long'><p>Returns the decoded fragment component of this URI.</p>\n\n<p> <p> The string returned by this method is equal to that returned by the\n getRawFragment method except that all\n sequences of escaped octets are <a href=\"#decode\">decoded</a>.  </p></p>\n<h3 class='pa'>Returns</h3><ul><li><span class='pre'>String</span><div class='sub-desc'><p>The decoded fragment component of this URI,\n          or {@code null} if the fragment is undefined</p>\n</div></li></ul></div></div></div><div id='method-getHost' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='java.net.URI'>java.net.URI</span><br/><a href='source/URI.html#java-net-URI-method-getHost' target='_blank' class='view-source'>view source</a></div><a href='#!/api/java.net.URI-method-getHost' class='name expandable'>getHost</a>( <span class='pre'></span> ) : String<span class=\"signature\"></span></div><div class='description'><div class='short'>Returns the host component of this URI. ...</div><div class='long'><p>Returns the host component of this URI.</p>\n\n<p> <p> The host component of a URI, if defined, will have one of the\n following forms: </p></p>\n\n<p> <ul></ul></p>\n\n<p>   <li><p> A domain name consisting of one or more <i>labels</i>\n   separated by period characters ({@code '.'}), optionally followed by\n   a period character.  Each label consists of <i>alphanum</i> characters\n   as well as hyphen characters ({@code '-'}), though hyphens never\n   occur as the first or last characters in a label. The rightmost\n   label of a domain name consisting of two or more labels, begins\n   with an <i>alpha</i> character. </p></li></p>\n\n<p>   <li><p> A dotted-quad IPv4 address of the form\n   <i>digit</i>{@code +.}<i>digit</i>{@code +.}<i>digit</i>{@code +.}<i>digit</i>{@code +},\n   where no <i>digit</i> sequence is longer than three characters and no\n   sequence has a value larger than 255. </p></li></p>\n\n<p>   <li><p> An IPv6 address enclosed in square brackets ({@code '['} and\n   {@code ']'}) and consisting of hexadecimal digits, colon characters\n   ({@code ':'}), and possibly an embedded IPv4 address.  The full\n   syntax of IPv6 addresses is specified in <a\n   href=\"http://www.ietf.org/rfc/rfc2373.txt\"><i>RFC&nbsp;2373: IPv6\n   Addressing Architecture</i></a>.  </p></li></p>\n\n<p> </p>\n\n<p> The host component of a URI cannot contain escaped octets, hence this\n method does not perform any decoding.</p>\n<h3 class='pa'>Returns</h3><ul><li><span class='pre'>String</span><div class='sub-desc'><p>The host component of this URI,\n          or {@code null} if the host is undefined</p>\n</div></li></ul></div></div></div><div id='method-getPath' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='java.net.URI'>java.net.URI</span><br/><a href='source/URI.html#java-net-URI-method-getPath' target='_blank' class='view-source'>view source</a></div><a href='#!/api/java.net.URI-method-getPath' class='name expandable'>getPath</a>( <span class='pre'></span> ) : String<span class=\"signature\"></span></div><div class='description'><div class='short'>Returns the decoded path component of this URI. ...</div><div class='long'><p>Returns the decoded path component of this URI.</p>\n\n<p> <p> The string returned by this method is equal to that returned by the\n getRawPath method except that all sequences of\n escaped octets are <a href=\"#decode\">decoded</a>.  </p></p>\n<h3 class='pa'>Returns</h3><ul><li><span class='pre'>String</span><div class='sub-desc'><p>The decoded path component of this URI,\n          or {@code null} if the path is undefined</p>\n</div></li></ul></div></div></div><div id='method-getPort' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='java.net.URI'>java.net.URI</span><br/><a href='source/URI.html#java-net-URI-method-getPort' target='_blank' class='view-source'>view source</a></div><a href='#!/api/java.net.URI-method-getPort' class='name expandable'>getPort</a>( <span class='pre'></span> ) : Number<span class=\"signature\"></span></div><div class='description'><div class='short'>Returns the port number of this URI. ...</div><div class='long'><p>Returns the port number of this URI.</p>\n\n<p> <p> The port component of a URI, if defined, is a non-negative\n integer. </p></p>\n<h3 class='pa'>Returns</h3><ul><li><span class='pre'>Number</span><div class='sub-desc'><p>The port component of this URI,\n          or {@code -1} if the port is undefined</p>\n</div></li></ul></div></div></div><div id='method-getQuery' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='java.net.URI'>java.net.URI</span><br/><a href='source/URI.html#java-net-URI-method-getQuery' target='_blank' class='view-source'>view source</a></div><a href='#!/api/java.net.URI-method-getQuery' class='name expandable'>getQuery</a>( <span class='pre'></span> ) : String<span class=\"signature\"></span></div><div class='description'><div class='short'>Returns the decoded query component of this URI. ...</div><div class='long'><p>Returns the decoded query component of this URI.</p>\n\n<p> <p> The string returned by this method is equal to that returned by the\n getRawQuery method except that all sequences of\n escaped octets are <a href=\"#decode\">decoded</a>.  </p></p>\n<h3 class='pa'>Returns</h3><ul><li><span class='pre'>String</span><div class='sub-desc'><p>The decoded query component of this URI,\n          or {@code null} if the query is undefined</p>\n</div></li></ul></div></div></div><div id='method-getRawAuthority' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='java.net.URI'>java.net.URI</span><br/><a href='source/URI.html#java-net-URI-method-getRawAuthority' target='_blank' class='view-source'>view source</a></div><a href='#!/api/java.net.URI-method-getRawAuthority' class='name expandable'>getRawAuthority</a>( <span class='pre'></span> ) : String<span class=\"signature\"></span></div><div class='description'><div class='short'>Returns the raw authority component of this URI. ...</div><div class='long'><p>Returns the raw authority component of this URI.</p>\n\n<p> <p> The authority component of a URI, if defined, only contains the\n commercial-at character ({@code '@'}) and characters in the\n <i>unreserved</i>, <i>punct</i>, <i>escaped</i>, and <i>other</i>\n categories.  If the authority is server-based then it is further\n constrained to have valid user-information, host, and port\n components. </p></p>\n<h3 class='pa'>Returns</h3><ul><li><span class='pre'>String</span><div class='sub-desc'><p>The raw authority component of this URI,\n          or {@code null} if the authority is undefined</p>\n</div></li></ul></div></div></div><div id='method-getRawFragment' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='java.net.URI'>java.net.URI</span><br/><a href='source/URI.html#java-net-URI-method-getRawFragment' target='_blank' class='view-source'>view source</a></div><a href='#!/api/java.net.URI-method-getRawFragment' class='name expandable'>getRawFragment</a>( <span class='pre'></span> ) : String<span class=\"signature\"></span></div><div class='description'><div class='short'>Returns the raw fragment component of this URI. ...</div><div class='long'><p>Returns the raw fragment component of this URI.</p>\n\n<p> <p> The fragment component of a URI, if defined, only contains legal URI\n characters. </p></p>\n<h3 class='pa'>Returns</h3><ul><li><span class='pre'>String</span><div class='sub-desc'><p>The raw fragment component of this URI,\n          or {@code null} if the fragment is undefined</p>\n</div></li></ul></div></div></div><div id='method-getRawPath' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='java.net.URI'>java.net.URI</span><br/><a href='source/URI.html#java-net-URI-method-getRawPath' target='_blank' class='view-source'>view source</a></div><a href='#!/api/java.net.URI-method-getRawPath' class='name expandable'>getRawPath</a>( <span class='pre'></span> ) : String<span class=\"signature\"></span></div><div class='description'><div class='short'>Returns the raw path component of this URI. ...</div><div class='long'><p>Returns the raw path component of this URI.</p>\n\n<p> <p> The path component of a URI, if defined, only contains the slash\n character ({@code '/'}), the commercial-at character ({@code '@'}),\n and characters in the <i>unreserved</i>, <i>punct</i>, <i>escaped</i>,\n and <i>other</i> categories. </p></p>\n<h3 class='pa'>Returns</h3><ul><li><span class='pre'>String</span><div class='sub-desc'><p>The path component of this URI,\n          or {@code null} if the path is undefined</p>\n</div></li></ul></div></div></div><div id='method-getRawQuery' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='java.net.URI'>java.net.URI</span><br/><a href='source/URI.html#java-net-URI-method-getRawQuery' target='_blank' class='view-source'>view source</a></div><a href='#!/api/java.net.URI-method-getRawQuery' class='name expandable'>getRawQuery</a>( <span class='pre'></span> ) : String<span class=\"signature\"></span></div><div class='description'><div class='short'>Returns the raw query component of this URI. ...</div><div class='long'><p>Returns the raw query component of this URI.</p>\n\n<p> <p> The query component of a URI, if defined, only contains legal URI\n characters. </p></p>\n<h3 class='pa'>Returns</h3><ul><li><span class='pre'>String</span><div class='sub-desc'><p>The raw query component of this URI,\n          or {@code null} if the query is undefined</p>\n</div></li></ul></div></div></div><div id='method-getRawSchemeSpecificPart' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='java.net.URI'>java.net.URI</span><br/><a href='source/URI.html#java-net-URI-method-getRawSchemeSpecificPart' target='_blank' class='view-source'>view source</a></div><a href='#!/api/java.net.URI-method-getRawSchemeSpecificPart' class='name expandable'>getRawSchemeSpecificPart</a>( <span class='pre'></span> ) : String<span class=\"signature\"></span></div><div class='description'><div class='short'>Returns the raw scheme-specific part of this URI. ...</div><div class='long'><p>Returns the raw scheme-specific part of this URI.  The scheme-specific\n part is never undefined, though it may be empty.</p>\n\n<p> <p> The scheme-specific part of a URI only contains legal URI\n characters. </p></p>\n<h3 class='pa'>Returns</h3><ul><li><span class='pre'>String</span><div class='sub-desc'><p>The raw scheme-specific part of this URI\n          (never {@code null})</p>\n</div></li></ul></div></div></div><div id='method-getRawUserInfo' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='java.net.URI'>java.net.URI</span><br/><a href='source/URI.html#java-net-URI-method-getRawUserInfo' target='_blank' class='view-source'>view source</a></div><a href='#!/api/java.net.URI-method-getRawUserInfo' class='name expandable'>getRawUserInfo</a>( <span class='pre'></span> ) : String<span class=\"signature\"></span></div><div class='description'><div class='short'>Returns the raw user-information component of this URI. ...</div><div class='long'><p>Returns the raw user-information component of this URI.</p>\n\n<p> <p> The user-information component of a URI, if defined, only contains\n characters in the <i>unreserved</i>, <i>punct</i>, <i>escaped</i>, and\n <i>other</i> categories. </p></p>\n<h3 class='pa'>Returns</h3><ul><li><span class='pre'>String</span><div class='sub-desc'><p>The raw user-information component of this URI,\n          or {@code null} if the user information is undefined</p>\n</div></li></ul></div></div></div><div id='method-getScheme' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='java.net.URI'>java.net.URI</span><br/><a href='source/URI.html#java-net-URI-method-getScheme' target='_blank' class='view-source'>view source</a></div><a href='#!/api/java.net.URI-method-getScheme' class='name expandable'>getScheme</a>( <span class='pre'></span> ) : String<span class=\"signature\"></span></div><div class='description'><div class='short'>Returns the scheme component of this URI. ...</div><div class='long'><p>Returns the scheme component of this URI.</p>\n\n<p> <p> The scheme component of a URI, if defined, only contains characters\n in the <i>alphanum</i> category and in the string {@code \"-.+\"}.  A\n scheme always starts with an <i>alpha</i> character. <p></p>\n\n<p> The scheme component of a URI cannot contain escaped octets, hence this\n method does not perform any decoding.</p>\n<h3 class='pa'>Returns</h3><ul><li><span class='pre'>String</span><div class='sub-desc'><p>The scheme component of this URI,\n          or {@code null} if the scheme is undefined</p>\n</div></li></ul></div></div></div><div id='method-getSchemeSpecificPart' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='java.net.URI'>java.net.URI</span><br/><a href='source/URI.html#java-net-URI-method-getSchemeSpecificPart' target='_blank' class='view-source'>view source</a></div><a href='#!/api/java.net.URI-method-getSchemeSpecificPart' class='name expandable'>getSchemeSpecificPart</a>( <span class='pre'></span> ) : String<span class=\"signature\"></span></div><div class='description'><div class='short'>Returns the decoded scheme-specific part of this URI. ...</div><div class='long'><p>Returns the decoded scheme-specific part of this URI.</p>\n\n<p> <p> The string returned by this method is equal to that returned by the\n getRawSchemeSpecificPart method\n except that all sequences of escaped octets are <a\n href=\"#decode\">decoded</a>.  </p></p>\n<h3 class='pa'>Returns</h3><ul><li><span class='pre'>String</span><div class='sub-desc'><p>The decoded scheme-specific part of this URI\n          (never {@code null})</p>\n</div></li></ul></div></div></div><div id='method-getUserInfo' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='java.net.URI'>java.net.URI</span><br/><a href='source/URI.html#java-net-URI-method-getUserInfo' target='_blank' class='view-source'>view source</a></div><a href='#!/api/java.net.URI-method-getUserInfo' class='name expandable'>getUserInfo</a>( <span class='pre'></span> ) : String<span class=\"signature\"></span></div><div class='description'><div class='short'>Returns the decoded user-information component of this URI. ...</div><div class='long'><p>Returns the decoded user-information component of this URI.</p>\n\n<p> <p> The string returned by this method is equal to that returned by the\n getRawUserInfo method except that all\n sequences of escaped octets are <a href=\"#decode\">decoded</a>.  </p></p>\n<h3 class='pa'>Returns</h3><ul><li><span class='pre'>String</span><div class='sub-desc'><p>The decoded user-information component of this URI,\n          or {@code null} if the user information is undefined</p>\n</div></li></ul></div></div></div><div id='method-hashCode' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='java.net.URI'>java.net.URI</span><br/><a href='source/URI.html#java-net-URI-method-hashCode' target='_blank' class='view-source'>view source</a></div><a href='#!/api/java.net.URI-method-hashCode' class='name expandable'>hashCode</a>( <span class='pre'></span> ) : Number<span class=\"signature\"></span></div><div class='description'><div class='short'>Returns a hash-code value for this URI. ...</div><div class='long'><p>Returns a hash-code value for this URI.  The hash code is based upon all\n of the URI's components, and satisfies the general contract of the\n Object.hashCode method.</p>\n<h3 class='pa'>Returns</h3><ul><li><span class='pre'>Number</span><div class='sub-desc'><p>A hash-code value for this URI</p>\n</div></li></ul></div></div></div><div id='method-isAbsolute' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='java.net.URI'>java.net.URI</span><br/><a href='source/URI.html#java-net-URI-method-isAbsolute' target='_blank' class='view-source'>view source</a></div><a href='#!/api/java.net.URI-method-isAbsolute' class='name expandable'>isAbsolute</a>( <span class='pre'></span> ) : Boolean<span class=\"signature\"></span></div><div class='description'><div class='short'>Tells whether or not this URI is absolute. ...</div><div class='long'><p>Tells whether or not this URI is absolute.</p>\n\n<p> <p> A URI is absolute if, and only if, it has a scheme component. </p></p>\n<h3 class='pa'>Returns</h3><ul><li><span class='pre'>Boolean</span><div class='sub-desc'><p>{@code true} if, and only if, this URI is absolute</p>\n</div></li></ul></div></div></div><div id='method-isOpaque' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='java.net.URI'>java.net.URI</span><br/><a href='source/URI.html#java-net-URI-method-isOpaque' target='_blank' class='view-source'>view source</a></div><a href='#!/api/java.net.URI-method-isOpaque' class='name expandable'>isOpaque</a>( <span class='pre'></span> ) : Boolean<span class=\"signature\"></span></div><div class='description'><div class='short'>Tells whether or not this URI is opaque. ...</div><div class='long'><p>Tells whether or not this URI is opaque.</p>\n\n<p> <p> A URI is opaque if, and only if, it is absolute and its\n scheme-specific part does not begin with a slash character ('/').\n An opaque URI has a scheme, a scheme-specific part, and possibly\n a fragment; all other components are undefined. </p></p>\n<h3 class='pa'>Returns</h3><ul><li><span class='pre'>Boolean</span><div class='sub-desc'><p>{@code true} if, and only if, this URI is opaque</p>\n</div></li></ul></div></div></div><div id='method-normalize' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='java.net.URI'>java.net.URI</span><br/><a href='source/URI.html#java-net-URI-method-normalize' target='_blank' class='view-source'>view source</a></div><a href='#!/api/java.net.URI-method-normalize' class='name expandable'>normalize</a>( <span class='pre'></span> ) : Object {java.net.URI}<span class=\"signature\"></span></div><div class='description'><div class='short'>Normalizes this URI's path. ...</div><div class='long'><p>Normalizes this URI's path.</p>\n\n<p> <p> If this URI is opaque, or if its path is already in normal form,\n then this URI is returned.  Otherwise a new URI is constructed that is\n identical to this URI except that its path is computed by normalizing\n this URI's path in a manner consistent with <a\n href=\"http://www.ietf.org/rfc/rfc2396.txt\">RFC&nbsp;2396</a>,\n section&nbsp;5.2, step&nbsp;6, sub-steps&nbsp;c through&nbsp;f; that is:\n </p></p>\n\n<p> <ol></ol></p>\n\n<p>   <li><p> All {@code \".\"} segments are removed. </p></li></p>\n\n<p>   <li><p> If a {@code \"..\"} segment is preceded by a non-{@code \"..\"}\n   segment then both of these segments are removed.  This step is\n   repeated until it is no longer applicable. </p></li></p>\n\n<p>   <li><p> If the path is relative, and if its first segment contains a\n   colon character ({@code ':'}), then a {@code \".\"} segment is\n   prepended.  This prevents a relative URI with a path such as\n   {@code \"a:b/c/d\"} from later being re-parsed as an opaque URI with a\n   scheme of {@code \"a\"} and a scheme-specific part of {@code \"b/c/d\"}.\n   <b><i>(Deviation from RFC&nbsp;2396)</i></b> </p></li></p>\n\n<p> </p>\n\n<p> <p> A normalized path will begin with one or more {@code \"..\"} segments\n if there were insufficient non-{@code \"..\"} segments preceding them to\n allow their removal.  A normalized path will begin with a {@code \".\"}\n segment if one was inserted by step 3 above.  Otherwise, a normalized\n path will not contain any {@code \".\"} or {@code \"..\"} segments. </p></p>\n<h3 class='pa'>Returns</h3><ul><li><span class='pre'>Object {java.net.URI}</span><div class='sub-desc'><p>A URI equivalent to this URI,\n          but whose path is in normal form</p>\n</div></li></ul></div></div></div><div id='method-parseServerAuthority' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='java.net.URI'>java.net.URI</span><br/><a href='source/URI.html#java-net-URI-method-parseServerAuthority' target='_blank' class='view-source'>view source</a></div><a href='#!/api/java.net.URI-method-parseServerAuthority' class='name expandable'>parseServerAuthority</a>( <span class='pre'></span> ) : Object {java.net.URI}<span class=\"signature\"></span></div><div class='description'><div class='short'>Attempts to parse this URI's authority component, if defined, into\n user-information, host, and port components. ...</div><div class='long'><p>Attempts to parse this URI's authority component, if defined, into\n user-information, host, and port components.</p>\n\n<p> <p> If this URI's authority component has already been recognized as\n being server-based then it will already have been parsed into\n user-information, host, and port components.  In this case, or if this\n URI has no authority component, this method simply returns this URI.</p>\n\n<p> <p> Otherwise this method attempts once more to parse the authority\n component into user-information, host, and port components, and throws\n an exception describing why the authority component could not be parsed\n in that way.</p>\n\n<p> <p> This method is provided because the generic URI syntax specified in\n <a href=\"http://www.ietf.org/rfc/rfc2396.txt\">RFC&nbsp;2396</a>\n cannot always distinguish a malformed server-based authority from a\n legitimate registry-based authority.  It must therefore treat some\n instances of the former as instances of the latter.  The authority\n component in the URI string {@code \"//foo:bar\"}, for example, is not a\n legal server-based authority but it is legal as a registry-based\n authority.</p>\n\n<p> <p> In many common situations, for example when working URIs that are\n known to be either URNs or URLs, the hierarchical URIs being used will\n always be server-based.  They therefore must either be parsed as such or\n treated as an error.  In these cases a statement such as</p>\n\n<p> <blockquote>\n {@code URI }<i>u</i>{@code  = new URI(str).parseServerAuthority();}\n </blockquote></p>\n\n<p> <p> can be used to ensure that <i>u</i> always refers to a URI that, if\n it has an authority component, has a server-based authority with proper\n user-information, host, and port components.  Invoking this method also\n ensures that if the authority could not be parsed in that way then an\n appropriate diagnostic message can be issued based upon the exception\n that is thrown. </p></p>\n<h3 class='pa'>Returns</h3><ul><li><span class='pre'>Object {java.net.URI}</span><div class='sub-desc'><p>A URI whose authority field has been parsed\n          as a server-based authority</p>\n</div></li></ul><h3 class='pa'>Throws</h3><ul><li><span class='pre'>Object</span><div class='sub-desc'><p>URISyntaxException\n          If the authority component of this URI is defined\n          but cannot be parsed as a server-based authority\n          according to RFC&nbsp;2396</p>\n</div></li></ul></div></div></div><div id='method-relativize' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='java.net.URI'>java.net.URI</span><br/><a href='source/URI.html#java-net-URI-method-relativize' target='_blank' class='view-source'>view source</a></div><a href='#!/api/java.net.URI-method-relativize' class='name expandable'>relativize</a>( <span class='pre'>uri</span> ) : Object {java.net.URI}<span class=\"signature\"></span></div><div class='description'><div class='short'>Relativizes the given URI against this URI. ...</div><div class='long'><p>Relativizes the given URI against this URI.</p>\n\n<p> <p> The relativization of the given URI against this URI is computed as\n follows: </p></p>\n\n<p> <ol></ol></p>\n\n<p>   <li><p> If either this URI or the given URI are opaque, or if the\n   scheme and authority components of the two URIs are not identical, or\n   if the path of this URI is not a prefix of the path of the given URI,\n   then the given URI is returned. </p></li></p>\n\n<p>   <li><p> Otherwise a new relative hierarchical URI is constructed with\n   query and fragment components taken from the given URI and with a path\n   component computed by removing this URI's path from the beginning of\n   the given URI's path. </p></li></p>\n\n<p> </p>\n<h3 class=\"pa\">Parameters</h3><ul><li><span class='pre'>uri</span> : Object {URI}<div class='sub-desc'><p>The URI to be relativized against this URI</p>\n</div></li></ul><h3 class='pa'>Returns</h3><ul><li><span class='pre'>Object {java.net.URI}</span><div class='sub-desc'><p>The resulting URI</p>\n</div></li></ul><h3 class='pa'>Throws</h3><ul><li><span class='pre'>Object</span><div class='sub-desc'><p>NullPointerException\n          If {@code uri} is {@code null}</p>\n</div></li></ul></div></div></div><div id='method-resolve' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='java.net.URI'>java.net.URI</span><br/><a href='source/URI.html#java-net-URI-method-resolve' target='_blank' class='view-source'>view source</a></div><a href='#!/api/java.net.URI-method-resolve' class='name expandable'>resolve</a>( <span class='pre'>str</span> ) : Object {java.net.URI}<span class=\"signature\"></span></div><div class='description'><div class='short'>Constructs a new URI by parsing the given string and then resolving it\n against this URI. ...</div><div class='long'><p>Constructs a new URI by parsing the given string and then resolving it\n against this URI.</p>\n\n<p> <p> This convenience method works as if invoking it were equivalent to\n evaluating the expression resolve{@code (URI.}create{@code (str))}. </p></p>\n<h3 class=\"pa\">Parameters</h3><ul><li><span class='pre'>str</span> : String<div class='sub-desc'><p>The string to be parsed into a URI</p>\n</div></li></ul><h3 class='pa'>Returns</h3><ul><li><span class='pre'>Object {java.net.URI}</span><div class='sub-desc'><p>The resulting URI</p>\n</div></li></ul><h3 class='pa'>Throws</h3><ul><li><span class='pre'>Object</span><div class='sub-desc'><p>NullPointerException\n          If {@code str} is {@code null}</p>\n</div></li><li><span class='pre'>Object</span><div class='sub-desc'><p>IllegalArgumentException\n          If the given string violates RFC&nbsp;2396</p>\n</div></li></ul></div></div></div><div id='method-toASCIIString' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='java.net.URI'>java.net.URI</span><br/><a href='source/URI.html#java-net-URI-method-toASCIIString' target='_blank' class='view-source'>view source</a></div><a href='#!/api/java.net.URI-method-toASCIIString' class='name expandable'>toASCIIString</a>( <span class='pre'></span> ) : String<span class=\"signature\"></span></div><div class='description'><div class='short'>Returns the content of this URI as a US-ASCII string. ...</div><div class='long'><p>Returns the content of this URI as a US-ASCII string.</p>\n\n<p> <p> If this URI does not contain any characters in the <i>other</i>\n category then an invocation of this method will return the same value as\n an invocation of the toString method.  Otherwise\n this method works as if by invoking that method and then <a\n href=\"#encode\">encoding</a> the result.  </p></p>\n<h3 class='pa'>Returns</h3><ul><li><span class='pre'>String</span><div class='sub-desc'><p>The string form of this URI, encoded as needed\n          so that it only contains characters in the US-ASCII\n          charset</p>\n</div></li></ul></div></div></div><div id='method-toString' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='java.net.URI'>java.net.URI</span><br/><a href='source/URI.html#java-net-URI-method-toString' target='_blank' class='view-source'>view source</a></div><a href='#!/api/java.net.URI-method-toString' class='name expandable'>toString</a>( <span class='pre'></span> ) : String<span class=\"signature\"></span></div><div class='description'><div class='short'>Returns the content of this URI as a string. ...</div><div class='long'><p>Returns the content of this URI as a string.</p>\n\n<p> <p> If this URI was created by invoking one of the constructors in this\n class then a string equivalent to the original input string, or to the\n string computed from the originally-given components, as appropriate, is\n returned.  Otherwise this URI was created by normalization, resolution,\n or relativization, and so a string is constructed from this URI's\n components according to the rules specified in <a\n href=\"http://www.ietf.org/rfc/rfc2396.txt\">RFC&nbsp;2396</a>,\n section&nbsp;5.2, step&nbsp;7. </p></p>\n<h3 class='pa'>Returns</h3><ul><li><span class='pre'>String</span><div class='sub-desc'><p>The string form of this URI</p>\n</div></li></ul></div></div></div><div id='method-toURL' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='java.net.URI'>java.net.URI</span><br/><a href='source/URI.html#java-net-URI-method-toURL' target='_blank' class='view-source'>view source</a></div><a href='#!/api/java.net.URI-method-toURL' class='name expandable'>toURL</a>( <span class='pre'></span> ) : Object {java.net.URL}<span class=\"signature\"></span></div><div class='description'><div class='short'>Constructs a URL from this URI. ...</div><div class='long'><p>Constructs a URL from this URI.</p>\n\n<p> <p> This convenience method works as if invoking it were equivalent to\n evaluating the expression {@code new URL(this.toString())} after\n first checking that this URI is absolute. </p></p>\n<h3 class='pa'>Returns</h3><ul><li><span class='pre'>Object {java.net.URL}</span><div class='sub-desc'><p>A URL constructed from this URI</p>\n</div></li></ul><h3 class='pa'>Throws</h3><ul><li><span class='pre'>Object</span><div class='sub-desc'><p>IllegalArgumentException\n          If this URL is not absolute</p>\n</div></li><li><span class='pre'>Object</span><div class='sub-desc'><p>MalformedURLException\n          If a protocol handler for the URL could not be found,\n          or if some other error occurred while constructing the URL</p>\n</div></li></ul></div></div></div></div></div></div></div>","meta":{}});